import React from 'react';

const MedicineList = ({ medicines, onDelete }) => {
    return (
      <ul>
        {medicines.map((medicine) => (
          <li key={medicine.id}>
            {medicine.name} - {medicine.price}
            <button onClick={() => onDelete(medicine.id)}>Delete</button>
          </li>
        ))}
      </ul>
      
      
    );
  };
  

export default MedicineList;
